import React,{Component} from 'react';
import './App.css';
import Form from './components/Form'

class  App extends Component {
  render() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 className="App-title">Users</h1>
      </header>
      <Form />
    </div>
  );
  }
}

export default App;
